Common Subexpression Elimination
Given the code:
x := (a + b) - c;
y := (a + b) * d;
The expression a + b is redundant and would be computed twice. The compiler would generate something like:
tmp := a + b;
x := tmp - c;
y := tmp * d;
This is a fairly basic optimization that pretty much all compilers do today.
Function Inlining
Given the code:
int add(int a, int b) {
  return a + b;
int main() {
  int x = add(1, 2);
  int y = add(3, 4);
